import React, { useEffect ,useState} from 'react';
import Table from 'react-bootstrap/Table';
import axios from 'axios';

export default function Tenantdata() {
    const [users, setUsers] = useState([])
    const [loading, setLoading] = useState(false)
    useEffect(() => {
      setLoading(true)
      fetch("http://localhost:8000/tenantdata")
        .then(response => response.json())
        .then(json => setUsers(json))
        .finally(() => {
          setLoading(false)
        })
    }, [])

  return (
 <div className="App">
      {loading ? (
        <div>Loading...</div>
      ) : (
        <>
          <h1>Users</h1>
          <table border={1}>
            <tr>
              <th>Name</th>
              <th>Email</th>
              <th>Phone</th>
            </tr>
            {users.map(user => (
              <tr key={user.id}>
                <td>{user.name}</td>
                <td>{user.email}</td>
                <td>{user.phone}</td>
              </tr>
            ))}
          </table>
        </>
      )}
    </div>
  )
}
